import './style/App.css';

function App() {

  return (
    <div className="App">
      <h1 className='header'>TO-DO LIST</h1>
        <ul className='to-do-list'>
          <li className='to-do'>
            <div>
              <strong>1. To-do item</strong>
            </div>
            <button>Delete</button>
          </li>
        </ul>
    </div>
  );
}

export default App;
